template<int ROWS, int COLS>
void matrixMultiply(const float mat[][COLS], const float vec[], float result[]) {
    for (int i = 0; i < ROWS; ++i) {
        result[i] = 0.0f;
        for (int j = 0; j < COLS; ++j) {
            result[i] += mat[i][j] * vec[j];
        }
    }
}

void addBias(float vec[], const float bias[], int size) {
    for (int i = 0; i < size; ++i) {
        vec[i] += bias[i];
    }
}

void logic(const float input[], float output[]) {
    float layer1[NUM_OF_LAYER1_NODES];
    matrixMultiply<NUM_OF_LAYER1_NODES, NUM_OF_INPUT_NODES>(weights1, input, layer1);
    addBias(layer1, biases1, NUM_OF_LAYER1_NODES);
    for (int i = 0; i < NUM_OF_LAYER1_NODES; ++i) layer1[i] = std::max(0.0f, layer1[i]);

    float layer2[NUM_OF_LAYER2_NODES];
    matrixMultiply<NUM_OF_LAYER2_NODES, NUM_OF_LAYER1_NODES>(weights2, layer1, layer2);
    addBias(layer2, biases2, NUM_OF_LAYER2_NODES);
    for (int i = 0; i < NUM_OF_LAYER2_NODES; ++i) layer2[i] = std::max(0.0f, layer2[i]);

    matrixMultiply<NUM_OF_OUTPUT_NODES, NUM_OF_LAYER2_NODES>(weights3, layer2, output);
    addBias(output, biases3, NUM_OF_OUTPUT_NODES);

    // Display results or further testing...
    for (int i = 0; i < NUM_OF_OUTPUT_NODES; i++) {
        std::cout << "Output " << i << ": " << output[i] << std::endl;
    }
}

int generateOutput(float outputArray[NUM_OF_OUTPUT_NODES]){
    int largest = 0;
    for (int i = 0; i < NUM_OF_OUTPUT_NODES; i++)
    {
        if (outputArray[i] > outputArray[largest]){
            largest = i;
        }
    }
    return largest;
}

float get_confidence(float output[], int num_classes, int predicted_class, float temperature = 1.0) {
    // Find maximum value for numerical stability
    float max_val = output[0];
    for(int i = 1; i < num_classes; i++) {
        if(output[i] > max_val) {
            max_val = output[i];
        }
    }

    // Calculate denominator of softmax with numerical stability
    float sum = 0.0f;
    for(int i = 0; i < num_classes; i++) {
        sum += exp((output[i] - max_val) / temperature);
    }

    // Calculate confidence for only the predicted class
    float confidence = exp((output[predicted_class] - max_val) / temperature) / sum;
    return confidence;
}

